package main

import "fmt"

func pathWithObstacles(obstacleGrid [][]int) [][]int {
	if obstacleGrid[0][0] == 1 {
		return nil
	}

	for i := 0; i < len(obstacleGrid); i++ {
		for j := 0; j < len(obstacleGrid[0]); j++ {
			if i == 0 && j == 0 {
				continue
			}
			if obstacleGrid[i][j] == 1 {
				continue
			}
			uf, lf := false, false
			if i == 0 || obstacleGrid[i-1][j] == 1 {
				uf = true
			}
			if j == 0 || obstacleGrid[i][j-1] == 1 {
				lf = true
			}
			if uf && lf {
				obstacleGrid[i][j] = 1
			}
		}
	}

	for i := len(obstacleGrid) - 1; i >= 0; i-- {
		for j := len(obstacleGrid[0]) - 1; j >= 0; j-- {
			if i == len(obstacleGrid)-1 && j == len(obstacleGrid[0])-1 {
				continue
			}
			if obstacleGrid[i][j] == 1 {
				continue
			}
			df, rf := false, false
			if i == len(obstacleGrid)-1 || obstacleGrid[i+1][j] == 1 {
				df = true
			}
			if j == len(obstacleGrid[0])-1 || obstacleGrid[i][j+1] == 1 {
				rf = true
			}
			if df && rf {
				obstacleGrid[i][j] = 1
			}
		}
	}

	// for _, v := range obstacleGrid {
	// 	fmt.Println(v)
	// }

	path := [][]int{{0, 0}}

	var dfs func(obstacleGrid [][]int) bool
	dfs = func(obstacleGrid [][]int) bool {

		p := path[len(path)-1]
		if obstacleGrid[p[0]][p[1]] == 1 {
			return false
		}
		if p[0] == len(obstacleGrid)-1 && p[1] == len(obstacleGrid[0])-1 {
			return obstacleGrid[p[0]][p[1]] != 1
		}

		if p[1] < len(obstacleGrid[0])-1 && obstacleGrid[p[0]][p[1]+1] != 1 {
			path = append(path, []int{p[0], p[1] + 1})
			ok := dfs(obstacleGrid)
			if !ok {
				path = path[0 : len(path)-1]
			} else {
				return true
			}
		}
		if p[0] < len(obstacleGrid)-1 && obstacleGrid[p[0]+1][p[1]] != 1 {
			path = append(path, []int{p[0] + 1, p[1]})
			ok := dfs(obstacleGrid)
			if !ok {
				path = path[0 : len(path)-1]
			} else {
				return true
			}
		}
		return false
	}
	ok := dfs(obstacleGrid)
	if !ok {
		return nil
	}
	return path
}

